function FootballPanTo(checkbox) {
	if (checkbox.checked) {
		var FootballPanPoint = map.panTo(L.latLng(40.876502, -124.076104), {animate: true, duration: 0.25});
	}
    else {
		map.removeLayer(FootballPanPoint);
     }
}

